import React from "react";
import { useNavigate } from "react-router-dom";

const Home = (props) => {
  const navigate = useNavigate();

  return (
    <div style={{ display: "flex", justifyContent: "center" }}>
      {/* Button */}
      <p>
        <button
          onClick={() => navigate("/services")}
          style={{ backgroundColor: "green", color: "white", width: "200px", height: "50px", borderRadius: "5px", margin: "10px" }}
        >
          Mint Token
        </button>
        <button
          onClick={() => navigate("/sell")}
          style={{ backgroundColor: "blue", color: "white", width: "200px", height: "50px", borderRadius: "5px", margin: "10px" }}
        >
          Sell an Item
        </button>
        <button
          onClick={() => navigate("/about")}
          style={{ backgroundColor: "red", color: "white", width: "200px", height: "50px", borderRadius: "5px", margin: "10px" }}
        >
          List all items for sale
        </button>
        <button
          onClick={() => navigate("/blog")}
          style={{ backgroundColor: "purple", color: "white", width: "200px", height: "50px", borderRadius: "5px", margin: "10px" }}
        >
          Change price of an item
        </button>
      </p>
    </div>
  );
};

export default Home;
